#### voucher inventory till 31st march

SELECT vr.brand_uid, count(vr.id), sum(vr.denomination) FROM udio_wallet.dgv_voucher_repo vr FORCE INDEX (idx_bs)
LEFT JOIN udio_wallet.dgv_user_voucher uv
ON uv.voucher_number=vr.voucher_code
AND uv.created_date BETWEEN '2018-04-01' AND '2019-04-01' 
WHERE vr.brand_uid IN ('amazon','flipkart','bookmyshow','myntra','cafecoffeeday','bigbazaar','vlcc','bigbasket'  )
AND vr.created_date BETWEEN '2018-04-01' AND '2019-04-01'
AND (vr.status='free' OR  (vr.status='expired' AND vr.expiry_date < '2019-04-01') OR  (vr.status = 'used' AND uv.id IS NULL)  )
GROUP BY vr.brand_uid;


select * from udio_wallet.dw_payout_request where merchant_id='1116' and status='refunded';

SELECT  count(id)  FROM udio_wallet.dw_user_wallet_voucher WHERE merchant_id = 40006939 AND voucher_type_id = 3;

select narration,mobile_number, amount, updated_date,status FROM udio_wallet.dw_payout_request where merchant_id='1116' and status='pending' and updated_date>='2019-02-01 00:00:00' and updated_date<='2019-06-25 23:59:59';

select consumer_id, balance, wallet_type_id from udio_wallet.dw_user_wallet where consumer_id = "8456847861212561265"

where balance > 0 and product_id = 2 and wallet_type_id = 5 and status = 'active' and created_date < CURDATE();

select bu.mobile_number, uw.balance, uw.wallet_type_id, vo.id, vo.name from udio_wallet.dw_user_wallet uw
inner join udio_wallet.dw_wallet_type vo
on uw.wallet_type_id = vo.id
inner join udio_wallet.b2c_user bu
on uw.consumer_id = bu.consumer_id
where uw.balance > 0
and uw.wallet_type_id = 5
and uw.product_id = 2
and uw.status = 'active'
;


select * from udio_wallet.b2c_user where mobile_number in("9929148812","9579506338","9350041350","9966910955","9602176629","9826509570","9527193541","8200592920","9998572386")

